// ==UserScript==
// @name         百度伪装谷歌
// @namespace    http://tampermonkey.net/
// @namespace    https://www.ianhe.me/
// @version      1.0.9
// @description  谷歌一下，你就知道
// @author       iHelin
// @match        *://www.baidu.com/*
// @grant        none
// ==/UserScript==

(function () {
    "use strict";

    // Your code here...

    var logo =
        "data:image/png;base64,";
    var resultLogo =
        "data:image/png;base64,";
    var nav_logo242 =
        "data:image/png;base64,";
    var favicon =
        "data:image/vnd.microsoft.icon;base64,";

    //修改 icon
    var link =
        document.querySelector("link[rel*='icon']") ||
        document.createElement("link");
    link.type = "image/x-icon";
    link.rel = "shortcut icon";
    link.href = favicon;
    document.getElementsByTagName("head")[0].appendChild(link);

    // 修改 title
    document.title = document.title.replace(/(.*)百度.*/gi, "$1Google");

    //修改中间logo
    var s_lg_img = document.getElementById("s_lg_img");
    var s_lg_img_new = document.getElementById("s_lg_img_new");
    if (s_lg_img) {
        s_lg_img.src = logo;
        s_lg_img.width = "272";
        s_lg_img.height = "92";
    }
    if (s_lg_img_new) {
        s_lg_img_new.src = logo;
        s_lg_img_new.width = "272";
        s_lg_img_new.height = "92";
    }

    // 修改结果页logo
    var result_logo = document.getElementById("result_logo");
    if (result_logo) {
        result_logo.children[0].src = resultLogo;
        result_logo.children[1].src = resultLogo;
    }

    //搜索按钮文字
    var su = document.getElementById("su");
    if (su) {
        su.value = "Google";
        setTimeout(function () {
            su.value = "Google";
        }, 1000);
    }

    var toindex = document.getElementsByClassName("toindex");
    if (toindex && toindex[0]) {
        toindex[0].innerText = "Google";
    }

    //熊掌
    var c = document.getElementById("page");
    if (c) {
        var firstChild = c.firstElementChild;
        var span = document.createElement("span");
        if (span) {
            span.style.background = "url(" + nav_logo242 + ")";
            span.style.width = "20px";
            span.style.backgroundPosition = "-24px -6px";
        }

        //    c.insertBefore(span,firstChild);
    }

    var a = document.getElementsByClassName("c-icon-bear-p");
    if (a && a.length) {
        a[0].style.background = "url(" + nav_logo242 + ")";
        a[0].style.backgroundPosition = "-54px -6px";
        a[0].style.width = "20px";
        a[0].style.top = 0;
    }
    var b = document.getElementsByClassName("c-icon-bear-pn");
    if (b) {
        for (var i = 0; i < b.length; i++) {
            b[i].style.background = "url(" + nav_logo242 + ")";
            b[i].style.backgroundPosition = "-74px -6px";
            b[i].style.width = "20px";
            b[i].style.top = 0;
        }
    }
})();
